// Compiler result to JSON file
import { createComponent } from 'js/declViewModelService';
import { registerDynImportEntry } from 'js/moduleLoader';
import AwParseService from 'js/awParseService';
import AwFilterService from 'js/awFilterService';
import { getField } from 'js/utils';
import { Fragment } from 'react';
let filterSer = AwFilterService.instance;



/*
render function
*/
import { pwaCommandBarRenderFunction } from 'js/PwaCommandBarService';


/*
ctx imports
*/

const ctxImportObj = {  };


/*
dynamic import
 */
registerDynImportEntry('js/PwaCommandBarService', () => import('js/PwaCommandBarService'));;

/*
view model
 */
const declViewModelJson = {
    "schemaVersion": "1.0.0",
    "actions": {
        "render": {
            "method": "pwaCommandBarRenderFunction",
            "deps": "js/PwaCommandBarService"
        }
    },
    "data": {},
    "messages": {},
    "conditions": {},
    "lifecycleHooks": {
        "render": "render"
    },
    "i18n": {},
    "props": {
        "mselected": {
            "type": "object"
        },
        "sub-panel-context": {
            "type": "object"
        },
        "pselected": {
            "type": "object"
        }
    },
    "_viewModelId": "PwaCommandBar",
    "_uniqueViewModelId": "PwaCommandBar",
    "ctx": {}
};




/*
define component
*/
const Component = createComponent( declViewModelJson, pwaCommandBarRenderFunction, undefined, ctxImportObj );

export default Component;
